;; @@
#_(for [b broadcasters]
  (plot-radius-dist b))
;; @@

;; **
;;; ## Evolutions
;; **

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (temporal-radius id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#222222"}]
         [:xlab "Day"]
         [:ylab "Temporal radius in minutes"]
         [:theme_bw]
         [:ggtitle "Average temporal radius evolution"])]
      {:width 5 :height 5}))
;; @@
